import React from 'react';
import { useNavigate } from 'react-router-dom';

import leftLandingBG from '../assets/leftLandingBG.png'
import rightLandingBG from '../assets/rightLandingBG.png'
import landingbg from '../assets/landingbg.jpeg'



const LandingBG = () => {
    const navigate = useNavigate();
    const handleLeftClick = () => navigate('/shop');
    const handleRightClick = () => navigate('/about');

    return (
        <div
            style={{
                height: '100vh',
                display: 'flex',
                justifyContent: 'space-between',
                backgroundRepeat: 'no-repeat',
                backgroundSize: 'cover',
            }}
        >
            <div
                style={{
                    width: '50%',
                    backgroundImage: `url(/path/to/leftImage)`,
                    cursor: 'pointer',
                }}
                onClick={handleLeftClick}
            />
            <div
                style={{
                    width: '50%',
                    backgroundImage: `url(/path/to/rightImage)`,
                    cursor: 'pointer',
                }}
                onClick={handleRightClick}
            />
        </div>
      );
}


export default LandingBG;
